import math

t = int(input())

for i in range(t):
    a, b = map(int, input().split())
    if a == b:
        print("NO")
    elif a < b:
        print("NO")
    else:
        if a % b == 0:
            print("NO")
        else:
            for j in range(2, int(math.sqrt(a)) + 1):
                if a % j == 0:
                    print("NO")
                    break
            else:
                print("YES")

import sys

t = int(sys.stdin.readline().strip())

for i in range(t):
    a, b = map(int, sys.stdin.readline().strip().split())
    if a == b:
        print("YES")
    elif a % b == 0:
        print("NO")
    else:
        print("YES")

